import React from "react";
import styles from "./FunFactItem.module.css";
import { FaQuoteLeft, FaQuoteRight } from "react-icons/fa";
const FunFactItem = (props) => {
  const { fact } = props;
  return (
    <div className={styles.fact}>
      <h1>{fact.title}</h1>

      <p>
        <FaQuoteLeft />
        {fact.text}
        <FaQuoteRight />
      </p>
    </div>
  );
};

export default FunFactItem;
